import React from 'react';
import "./home.css";
import $ from "jquery";


function Preloader() {


  $(window).on('load', function () {

    function fadeOut(i) { 
      setTimeout(function() { 
        $(`.preloader-circle:eq(${i})`).css("opacity", "0 !Important");
        console.log(i);
      }, 250 * i); 
    } 

    setTimeout(() => {

      for (let i = 0; i < 10; i++) {
        fadeOut(i);
      }     
    }, 2000);

  });

  return (
    <div className="Preloader-container">
      <div className="preloader">
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        <div className="preloader-circle"></div>
        </div>
    </div>
  );
}

export default Preloader;
